import React from "react";
import styled from "styled-components";
import HomeIcon from "@mui/icons-material/Home";

function Header() {
  return (
    <Container>
      <a>
        <HomeIcon />
      </a>
      <Menu>
        <p>
          <a href="#">Account</a>
        </p>
        <p>
          <a href="#">About</a>
        </p>
        <p>
          <a href="#">Contact</a>
        </p>
      </Menu>
    </Container>
  );
}

export default Header;

const Container = styled.div`
  min-height: 40px;
  position: fixed;
  display: flex;
  align-items: center;
  padding: 0 20px;
`;

const Menu = styled.div`
  display: flex;
  align-items: center;
  p {
    font-weight: 600;
    text-decoration: uppercase;
  }
`;
